/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`ivradmin`@`%` SQL SECURITY DEFINER VIEW `vw_get_complaints` AS select `c`.`complaint_num` AS `compl_id`,`c`.`daily_counter` AS `daily_counter`,`c`.`product_category` AS `product_category`,`c`.`product_id` AS `product_id`,`c`.`complaint_type_id` AS `complaint_type_id`,`c`.`priority_id` AS `priority_id`,`c`.`status_id` AS `status_id`,`c`.`progress` AS `progress`,`c`.`file_counter` AS `file_counter`,`c`.`comments` AS `comments`,`c`.`comments_progress` AS `comments_progress`,`c`.`is_approved` AS `is_approved`,`c`.`comments_verified` AS `comments_verified`,`c`.`create_date` AS `create_date`,`c`.`end_date` AS `end_date`,`c`.`forward_date` AS `forward_date`,`c`.`close_date` AS `close_date`,`tbl_complaint_details`.`compl_title` AS `compl_title`,`tbl_complaint_details`.`cnic` AS `cnic`,`tbl_complaint_details`.`customer_name` AS `customer_name`,`tbl_complaint_details`.`account_no` AS `account_no`,`tbl_complaint_details`.`complaint_nature` AS `complaint_nature`,`tbl_complaint_details`.`channel` AS `channel`,`tbl_complaint_details`.`complaint_measures` AS `complaint_measures`,`tbl_complaint_details`.`description` AS `description`,`tbl_complaint_details`.`callback_num` AS `callback_num`,`tbl_complaint_details`.`delivery_address` AS `delivery_address`,`tbl_complaint_details`.`residence_address` AS `residence_address`,`tbl_complaint_details`.`office_address` AS `office_address`,`tbl_complaint_details`.`alternate_address` AS `alternate_address`,`tbl_complaint_details`.`email` AS `email`,`tbl_complaint_details`.`office_phone` AS `office_phone`,`tbl_complaint_details`.`mobile_number` AS `mobile_number`,`tbl_complaint_details`.`residence_phone` AS `residence_phone`,`tbl_complaint_details`.`is_email` AS `is_email`,`tbl_complaint_details`.`customer_email` AS `customer_email`,`tbl_complaint_details`.`is_sms` AS `is_sms`,`tbl_complaint_details`.`response_number` AS `response_number`,`tbl_complaint_details`.`is_call_back` AS `is_call_back`,`us`.`user_name` AS `users`,`tbl_users`.`user_name` AS `agent_name`,`tbl_groups`.`group_name` AS `group_fullname`,`pr`.`priority` AS `priority`,(case when ((`c`.`progress` = 0) and (`c`.`status_id` = 2)) then 'forward' else `tbl_status`.`fullname` end) AS `status`,`c`.`source` AS `source`,`tbl_complaint_type`.`fullname` AS `type`,`tbl_product`.`fullname` AS `product_name` from ((((((((`tbl_complaints` `c` join `tbl_complaint_details` on((`tbl_complaint_details`.`complaint_id` = `c`.`complaint_id`))) left join `tbl_users` on((`c`.`agent_id` = `tbl_users`.`id`))) join `tbl_priority` `pr` on((`pr`.`id` = `c`.`priority_id`))) join `tbl_status` on((`c`.`status_id` = `tbl_status`.`id`))) join `tbl_product` on((`tbl_product`.`id` = `c`.`product_id`))) join `tbl_complaint_type` on((`c`.`complaint_type_id` = `tbl_complaint_type`.`id`))) left join `tbl_groups` on((`c`.`group_id` = `tbl_groups`.`id`))) left join `tbl_users` `us` on((`us`.`id` = `c`.`user_id`))) where (1 = 1) */;

